import React from "react";
import './Footer.css'

function Footer() {
    return (
        <>
            <div className="Footer">
                <div className="Footer__container-top">
                    <img src="Logo_PNG_horizontal.png" alt="img" className="HeaderOne__Logo"/>
                </div>
            </div>
        </>
    )
}

export default Footer
